import styled from "styled-components";

export const PlayerVolumeWrapper = styled.div`
  background-color: #fff;
  position: absolute;
  left: 88%;
  bottom: 46px;

  .ant-slider {
    display: "inline-block";
    height: 100px;
  }
`;
